    //         response.json()).then(posts => console.log(posts));
    //     console.log("hello");
    // }

    render() {

        console.log(this.pastBookings);
        const columns = [
            {
                Header: "Service Provider"
            },
            {
                Header: "Employee"
            },
            {
                Header: "Date"
            }

        ];

        return (
            <div>
                <ReactTable columns={columns} />
            </div>
        )
    }
}

export default PastBookingsTable;
